import React from "react";
import gaana from "../img/gaana.jpg";

const Partners = () => (
  <div className="partners">
    <img src="{gaana}" width="150px" height="150px" alt="gaana" />
    <img src="{gaana}" alt="gaana" />
    <img src="{gaana}" alt="gaana" />
    <img src="{gaana}" alt="gaana" />
  </div>
);

export default Partners;
